void EnergyConsumerInit(struct EnergyConsumer* me) {
    me->currentDemandWatts = 1;
    //me->futureDemandWatts = (int)round(2 + 2*sin((2*PI) / TICKS_PER_CARS_PERIOD)) * WATTS_DEMAND_PER_CAR;
    me->futureDemandWatts = demand[0];
    me->previousDemandWatts = 1;
    me->totalConsumedWatts = 0;
    me->currentTick = 0;
}

void EnergyConsumerUpdateDemand(struct EnergyConsumer* me, int deltaTick) {
    //me->currentDemandWatts = 100 - me->currentDemandWatts;
    me->currentTick += deltaTick;
    me->previousDemandWatts = me->currentDemandWatts;
    me->currentDemandWatts = me->futureDemandWatts;
    //double numCars = 2 + 2*sin((double)(me->currentTick + 1) * (2*PI) / TICKS_PER_CARS_PERIOD);
    // double numCars = 2;
	// int numCarsInt = (int)round(numCars);
	// if(numCarsInt < 0)
	// 	numCarsInt = 0;
    me->futureDemandWatts = demand[me->currentTick];
}

void EnergyConsumerConsumeWatts(struct EnergyConsumer* me, double watts) {
    me->totalConsumedWatts += watts;
}

double EnergyConsumerGetDemandWatts(struct EnergyConsumer* me) {
    return me->currentDemandWatts;
}

double EnergyConsumerGetTotalWattsConsumption(struct EnergyConsumer* me) {
    return me->totalConsumedWatts;
}
